import React, { Component } from 'react';

export default class LeaderBoard extends Component {
	render() {
		return (
			<div className="leaderboard">
				<h1>Leaderboard</h1>
				<table className="table">
					<thead>
						<tr>
							<th>Rank</th>
							<th>Player</th>
							<th>Points</th>
						</tr>
					</thead>
					<tbody>
						<tr>
							<td>The table body</td>
							<td>with two columns</td>
						</tr>
					</tbody>
				</table>
			</div>
		);
	}
}
